USE team102_2016;

CREATE TABLE `matches` (
  `tournament_id` varchar(20) NOT NULL,
  `match_number` int(11) NOT NULL,
  `start_time` varchar(20) DEFAULT NULL,
  `red_score` int(11) DEFAULT NULL,
  `blue_score` int(11) DEFAULT NULL,
  `ignore_match` varchar(1) NOT NULL DEFAULT 'N',
  `red_breach` varchar(1) NOT NULL DEFAULT 'N',
  `blue_breach` varchar(1) NOT NULL DEFAULT 'N',
  `red_capture` varchar(1) NOT NULL DEFAULT 'N',
  `blue_capture` varchar(1) NOT NULL DEFAULT 'N',
  `red_spy_human` varchar(1) NOT NULL DEFAULT 'N',
  `blue_spy_human` varchar(1) NOT NULL DEFAULT 'N',
  PRIMARY KEY (`tournament_id`,`match_number`),
  CONSTRAINT `match_tour_id` FOREIGN KEY (`tournament_id`) REFERENCES `tournaments` (`ID`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


